import React from 'react';

const Img1 = () => {
  return (
    // Am adăugat bg-blue-800 pentru un fundal albastru închis
    <div className="relative w-64 h-64 flex justify-center items-center mx-auto bg-white">
      {/* Pot ajusta opacitatea și culoarea pentru a crește vizibilitatea */}
      <div className="absolute w-32 h-32 bg-red-400 rounded-full opacity-75 mix-blend-multiply"></div>
      <div className="absolute w-32 h-32 bg-green-400 rounded-full opacity-75 mix-blend-multiply" style={{ transform: 'translateX(50%)' }}></div>
      <div className="absolute w-32 h-32 bg-blue-200 rounded-full opacity-75 mix-blend-multiply" style={{ transform: 'translateY(50%)' }}></div>
    </div>
  );
};

export default Img1;
